Use #[derive(accounts)] attribute to define agrument accounts. By doing so, we define what accounts should we pass to an instruction. Then at each instruction, we define its argument accounts by wrapping the struct with Context. There are two types of accounts in this example. For the instructions, setting value, increment, and decrement, we only need to pass the state account so they share one struct called Update. On the other hand, For initialization, we also need to pass the payer and the system program ID to out program so we define another struct called Initialize. Let's see the code. #[program]
pub mod set_counter_anchor { use super::*; pub fn initialize(ctx: Context<Initialize>) -> Result<()> { Ok(()) } pub fn decrement(ctx: Context<Update>) -> Result<()> { Ok(()) } pub fn increment(ctx: Context<Update>) -> Result<()> { Ok(()) } pub fn set(ctx: Context<Update>, value: u32) -> Result<()> { Ok(()) }
} #[derive(Accounts)]
pub struct Initialize<'info> { #[account(init, payer = user, space = 8 + 4)] pub state: Account<'info, State>, #[account(mut)] pub user: Signer<'info>, pub system_program: Program<'info, System>
} #[derive(Accounts)]
pub struct Update<'info> { #[account(mut)] pub state: Account<'info, State>
}

