pub mod set_counter_anchor { use super::*; pub fn initialize(ctx: Context<Initialize>) -> Result<()> { let state = &mut ctx.accounts.state; state.counter = 0; // init the counter Ok(()) } pub fn decrement(ctx: Context<Update>) -> Result<()> { let state = &mut ctx.accounts.state; state.counter = state.counter.checked_sub(1).unwrap_or(0); // avoid overflow Ok(()) } pub fn increment(ctx: Context<Update>) -> Result<()> { let state = &mut ctx.accounts.state; state.counter = state.counter.checked_add(1).unwrap_or(u32::MAX); // avoid overflow Ok(()) } pub fn set(ctx: Context<Update>, value: u32) -> Result<()> { let state = &mut ctx.accounts.state; state.counter = value; Ok(()) }
}

